package design.Service.ServiceImpl;

import com.fasterxml.jackson.databind.JsonNode;
import com.fasterxml.jackson.databind.ObjectMapper;
import org.springframework.stereotype.Service;

import javax.crypto.Cipher;
import javax.crypto.spec.IvParameterSpec;
import javax.crypto.spec.SecretKeySpec;
import javax.xml.bind.DatatypeConverter;

/**
 * @author Zk
 * @date 2023/03/15/22:02
 */
@Service("MangaService")
public class MangaServiceImpl {
    public JsonNode getMangaJson(){
        String Key = "xxxmanga.woo.key";
//        String initVector = "encryptionIntVec";
        String value = "";
        String iv = value.substring(0, 16);
        String substring = value.substring(16);
        byte[] bytes = DatatypeConverter.parseHexBinary(substring);
        try {
            IvParameterSpec ivParameterSpec = new IvParameterSpec(iv.getBytes("UTF-8"));
            SecretKeySpec aes = new SecretKeySpec(Key.getBytes("UTF-8"), "AES");
            Cipher cipher = Cipher.getInstance("AES/CBC/PKCS5PADDING");
            cipher.init(Cipher.DECRYPT_MODE, aes, ivParameterSpec);
            byte[] original = cipher.doFinal(bytes);
            ObjectMapper objectMapper = new ObjectMapper();
            JsonNode jsonNode = objectMapper.readTree(original);
            System.out.println(jsonNode.toString());
            return jsonNode;
        } catch (Exception e) {
            e.printStackTrace();
        }
        return null;
    }
}
